import React, { Component } from 'react';

export class search extends Component {
    render() {
        return (

                        <div className="col-lg-4">
                            <div className="header-search-block">
                                <input type="text" placeholder="Search entire store here" />
                                <button>Search</button>
                            </div>
                        </div>

        );
    }
}
